import React from "react";
import "./Sidebar.css";
import FiberManualRecordIcon from "@material-ui/icons/FiberManualRecord";
import InsertCommentIcon from "@material-ui/icons/InsertComment";
import CreateIcon from "@material-ui/icons/Create";
import SidebarOption from "./SidebarOption";

function Sidebar() {
  return (
    <div className="sidebar">
      <div className="sidebar_header">
        <div className="sidebar_info">
          <h2>Developer Gang</h2>
          <h3>
            <FiberManualRecordIcon />
            Anonymous_Intruder
          </h3>
        </div>
        <CreateIcon />
      </div>
      <SidebarOption Icon={InsertCommentIcon} title="Threads" />
      <SidebarOption Icon={InboxIcon} title="Mention" />
      <SidebarOption Icon={DraftsIcon} title="Saved" />
      <SidebarOption Icon={BookmarkBorderIcon} title="Bookmark" />
      <SidebarOption Icon={PeopleAltIcon} title="People" />
      <SidebarOption Icon={AppsIcon} title="Apps" />
      <SidebarOption Icon={FileCopyIcon} title="File" />
      <SidebarOption Icon={ExpandLessIcon} title="Expand" />
    </div>
  );
}

export default Sidebar;
